import React from 'react';
import './App.css';
import DataVisualization from './components/DataVisualization';
import MapComponent from './components/MapComponent';
import DemographicsPieChart from './components/DemographicsPieChart';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme/theme';
import CssBaseline from '@mui/material/CssBaseline';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import logo from './logo.png'; // Ensure this path matches your logo's location

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div
        className="hero-section"
        style={{
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          flexDirection: 'column',
        }}
      >
        <div
          style={{
            display: 'flex',
            alignItems: 'center',
            marginBottom: '20px',
          }}
        >
          <img
            src={logo}
            alt="Logo"
            style={{ marginRight: '20px', height: '50px' }}
          />
          <Typography variant="h3" style={{ color: '#333' }}>
            Explore. Discover. Decide.
          </Typography>
        </div>
        <Typography variant="subtitle1" style={{ color: '#333' }}>
          Dive into the world of locale data to make an informed decision with
          Nest Quest.
        </Typography>
      </div>
      <Container maxWidth="lg">
        <Paper elevation={3} className="main-content">
          {/* Data Visualization Component Title */}
          <Typography variant="h4" style={{ marginTop: '20px', color: '#333' }}>
            Insights Dashboard
          </Typography>
          <Typography
            variant="subtitle2"
            style={{ marginBottom: '20px', color: '#666' }}
          >
            Interactive overview of city metrics for informed decision-making.
          </Typography>
          <div className="visualization-container">
            <DataVisualization />
          </div>

          {/* Map Component Title */}
          <Typography variant="h4" style={{ marginTop: '40px', color: '#333' }}>
            Cities on the Map
          </Typography>
          <Typography
            variant="subtitle2"
            style={{ marginBottom: '20px', color: '#666' }}
          >
            Geographic locations and key facts.
          </Typography>
          <div className="map-container">
            <MapComponent />
          </div>

          <div className="demographics-chart-container">
            <DemographicsPieChart />
          </div>
        </Paper>
      </Container>
      <div className="footer">
        <Typography variant="body1">Nest Quest Â©2024</Typography>
      </div>
    </ThemeProvider>
  );
}

export default App;
